const styles = (theme) => ({
  cellName: {
    ...theme.mixins.breakword,
    width: '25%',
  },
  row: {
    cursor: 'pointer',
  },
  hover: {
    cursor: 'pointer',
  },
  dataCellLast: {
    borderTop: '1px solid #eeeeee',
  },
});

export default styles;
